              <div className="col-12 bg teste4">
             <h1 class="destaque1"> + do que simplesmente viajar!</h1>
             <h3><span class="destaque">Viaje + </span>trabalha com roteiros culturais e historicos tornando sua viagem uma experiencia unica!</h3>
             </div>
         </section>
            </div>
     )
}

export default Sobre;
